import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Provider } from 'react-redux';

import generateStores from './Store/store';
const store= generateStores();

ReactDOM.render(

   <Provider store={store}>
   <App />
   </Provider>




 ,
